				\begin{document}$$ {\text{PCE}} = \frac{{V_{\hbox{max} } \times J_{\hbox{max} } }}{{P_{\text{in}} }} \times 100\;\% = \frac{{V_{\text{oc}} \times J_{\text{sc}} \times FF}}{{P_{\text{in}} }} \times 100\;\% $$\end{document}where Vmax and Jmax are, respectively, the voltage and the current density under the maximum power output in the J–V curves, JSC is the short-circuit current density (mA cm−2), VOC is the open-circuit voltage (V), and Pin is the incident light power. EIS was examined at the open-circuit potential under the same illumination condition as the measurement of the J–V curves. The data were obtained by using Z-view software NOVA 1.7 to analyze the results from Auto-lab electrochemical work station (model AUT84315, the Netherlands) [39].
